import Tada from "react-reveal/Tada";
import RubberBand from "react-reveal/RubberBand";

import "./App.css";

function App() {
  return (
    <div className="App">
      <Tada>
        <h1>Alphonce</h1>
      </Tada>
      <RubberBand>
        <h2>Coming Soon</h2>
      </RubberBand>
    </div>
  );
}

export default App;
